    padding: 0 18px 0 20px;
    height: 64px;
  }

  &__links {
    display: none;
  }

  &__content {
    display: flex;
    flex-direction: column;
    align-items: center;
    margin: 0 auto;
    background-image: url(../images/background-cookie.png);
    background-repeat: no-repeat;
    background-size: 288px;
    background-position-x: center;
    background-position-y: center;
  }

  &__description {
    margin-bottom: 32px;
    font-size: 16px;
    line-height: 24px;
    text-align: center;
    letter-spacing: -0.01em;
    color: $main-black;
  }

  &__title {
    margin-bottom: 290px;

    font-size: 64px;
    line-height: 54px;
    text-align: center;
    letter-spacing: -0.05em;
    text-transform: uppercase;
    color: $main-black;
  }

  &__button {
    box-sizing: border-box;
    display: flex;
    justify-content: center;
    align-items: center;
    gap: 6px;
    margin-bottom: 104px;
    width: 288px;
    height: 56px;
    text-decoration: none;
    color: $main-orange;
    border: 2px solid $main-orange;
    border-radius: 32px;

    transition: all, 0.3s;

    &--icon svg {
      fill: $main-orange;
      transition: all 0.3s;
    }

    &--icon:hover svg {
      stroke: $main-white;
      fill: $main-white;
    }

    &--icon:focus svg {
      stroke: $main-white;
      fill: $main-white;
    }

    &:hover {
      background-color: $main-orange;
      border-color: $main-orange;
      color: $main-white;
    }

    &:focus {
      background-color: $dark-orange;
      border-color: $dark-orange;
      color: $main-white;
    }

    &-text {
      font-weight: 500;
      font-size: 16px;
      line-height: 16px;
      letter-spacing: 0.02em;
      text-transform: uppercase;
    }
  }

  @include onTablet {
    &__nav {
      margin-bottom: 80px;
    }

    &__content {
      margin-bottom: 228px;
      background-size: 326px;
      background-position-y: 35%;
    }

    &__description {
      margin-bottom: 146px;

      align-self: start;
      padding-left: 44px;
      width: 360px;
      text-align: start;
    }

    &__title {
      margin-bottom: 210px;
      font-size: 80px;
      line-height: 68px;
    }

    &__button {
      margin-bottom: 0;
      width: 326px;
    }
  }

  @include onLaptop {
    &__nav {
      margin-bottom: 0;
      height: 88px;
      padding: 0 32px 0 36px;
    }

    &__links {
      display: flex;
    }

    &__link {
      margin-right: 64px;
      font-size: 16px;
      line-height: 24px;
      letter-spacing: -0.01em;
      text-decoration: none;
      color: $main-black;
      transition: color 0.3s;

      &:hover {
        color: $main-orange;
      }

      &:last-child {
        margin-right: 0;
      }
    }

    &__link-container {
      display: flex;
      align-items: center;
    }

    &__phone-img {
      width: 18px;
      height: 18px;
      margin-right: 7px;
